  input: TEXT,F3XA,,"Dear Mr. Gibson -  In response to your letter of June 12, 2003,
    please find the following points of information with the attached amended report.  1)
    I have been more specific on the nature of these expenses as requested.  2) I
    have clarified these expenses on the report, but wanted to elaborate that these
    ads were not made on behalf of any federal candidates, and were generic in nature,
    encouraging voters to 'vote Democratic'.  3) The memo entries for the credit card
    payments have been appended in.  If you have any questions, please feel free to
    contact me.  Sincerely,  Chris Gallaway, Assistant Treasurer"
